@import 'variables';

th {
  text-align: left;
}

.p1-table {
  border-radius: $p1-gutter-size-small $p1-gutter-size-small 0 0;
  margin: 0;
  padding: 0;
  width: 100%;

  tr {
    height: 6rem;

    td.name {
      padding-left: 0;

      .inner {
        display: flex;
        justify-content: space-between;
      }
    }

    th.title {
      font-weight: 600;
      padding-left: 0;
    }

    .checkbox {
      margin-right: 1.3rem;
      width: 1rem;
    }
  }

  .status {
    display: flex;
    justify-content: center;
    padding: 0 $p1-gutter-size-small;

    &.active {
      background-color: $p1-active-period-color;
      color: $p1-white-color;
    }

    &.inactive {
      color: #000;
      opacity: 0.3;
    }

    span {
      font-size: 1.5rem;
      font-stretch: normal;
      letter-spacing: normal;
      line-height: 2;
    }
  }
}

